import React from "react";

function Header() {
  return (
    <header>
      <h1>
        StuffMart
        <span className="logo" role="img">
          <img href="./StuffMart.jpg" alt="Pic" />
        </span>
      </h1>
    </header>
  );
}

export default Header;
